Ingredientes:
–       300g de carne moída magra 
–       700g de abóbora cortada em cubos (eu gosto da cabótia ou japonesa)
–       1 cebola picada
–       1 tomate picado
–       salsinha a gosto
–       ½ copo de água
–       ½ xícara de molho de tomate
–       sal e pimenta do reino
–       tempero sírio em pó (opcional)

Modo de Preparo:
–       Refogue a carne e a cebola, sem usar óleo.
–       Acrescente o tomate.
–       Junte a abóbora, a água e o molho de tomate, Tampe a panela e  deixe por cerca de 15 minutos ou até a abóbora estar macia. Se necessário, coloque mais um pouco de água para não grudar na panela.
–       No final, adicione todos os temperos e sirva!
